import React, { useState, useEffect } from "react";
import * as tagData from "../lib/api/getData";
import MainTrend from "../component/mainTrend";
import styled from "styled-components";

const TagTitle = styled.div`
  font-size: 30px;
`;

function Main() {
  const [gap, setGap] = useState({});

  useEffect(async () => {
    setGap(await tagData.mainData);
  }, []);
  return (
    <>
      <div>
        <TagTitle>최근 1일 포스팅 증가량 높은 순위</TagTitle>
        {gap.day1_gap.map((data) => {
          return <div>{data.hashtag}</div>;
        })}
      </div>
    </>
  );
}

export default Main;
